import SwiftUI

protocol CharacterView {
    var id: Int { get }
    var defaultName: String { get }
    var currentExpression: Int { get set }
    var currentScale: CGFloat { get set }
}

class EachCharactersView {
    struct Serika: View, CharacterView {
        var id = 0
        var defaultName = "茜香"
        var currentExpression = 0
        var currentScale: CGFloat = 0.7
        var body: some View {
            ZStack(alignment: .topLeading) {
                GeometryReader { geometry in
                    Image(uiImage: CharacterMeta.Serika().mainBody)
                        .resizable()
                        .aspectRatio(contentMode: .fit)
                        .frame(width: geometry.size.width * currentScale, height: geometry.size.height * currentScale)
                }
                GeometryReader { geometry in
                    Image(uiImage: CharacterMeta.Serika().expressions[0])
                        .resizable()
                        .aspectRatio(contentMode: .fit)
                        .frame(width: geometry.size.width * currentScale, height: geometry.size.height * currentScale)
                        .position(CharacterMeta.Serika().exprLoc)
                }
            }
        }
    }
}
private class CharacterMeta {
    func base64ToImage(from inp: String) -> UIImage {
        let dataDecoded = Data(base64Encoded: inp, options: NSData.Base64DecodingOptions(rawValue: 0))!
        let decodedimage = UIImage(data: dataDecoded)!
        return decodedimage
    }
    
    class Serika {
        var expressions = [CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: ""), CharacterMeta().base64ToImage(from: "")]
        var mainBody = CharacterMeta().base64ToImage(from: "")
        var exprLoc = CGPoint(x: 85, y: 74)
    }
}

